import { COMPONENT, ROW, COLUMN } from "./constants";

const initialData = {
    layout: [{
        type: ROW,
        id: "row0",
        children: [{
                type: COMPONENT,
                id: "component0",
                children: [{
                    type: COMPONENT,
                    id: "component0"
                }]
            },
            {
                type: COLUMN,
                id: "column1",
                children: [{
                    type: COMPONENT,
                    id: "component1"
                }]
            },
            {
                type: COLUMN,
                id: "column2",
                children: [{
                    type: COMPONENT,
                    id: "component2"
                }]
            },
            {
                type: COLUMN,
                id: "column3",
                children: [{
                    type: COMPONENT,
                    id: "component3"
                }]
            },
            {
                type: COLUMN,
                id: "column4",
                children: [{
                    type: COMPONENT,
                    id: "component4"
                }]
            }
        ]
    }],
    components: {
        component0: { id: "component0", type: "input", content: "---|   |---" },
        component1: { id: "component1", type: "image", content: "Some image" },
        component2: { id: "component2", type: "email", content: "Some email" },
        component3: { id: "component3", type: "name", content: "Some name" },
        component4: { id: "component4", type: "phone", content: "Some phone" }
    }
};

export default initialData;
